import React from "react";
import Home from "./Routes/Home";
import About from "./Routes/Home";
import Contact from "./Routes/Home";
import Project from "./Routes/Home";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <>
      <Routes>
        <Route path="/"/>
        <Route path="/about" />
        <Route path="/contact" />
        <Route path="/project"/>
      </Routes>
    </>
  );
}

export default App;
